import styles from './List.module.scss';


const List = () => {
    return (
        <list className={styles.list}>
            <header className={styles.header}>Things to do soon!</header>
            {/* <title className={styles.title} Interesting things I want to check out </title> */}
            <columns className={styles.columns}>
            <description className={styles.description}>Books</description>  
                    Movies
                    Games
            </columns>    
        </list>
    );
};

export default List;
